    //The following types are used for testing, to facilitate data analysis
    public static class TxObj {
        private String mmId;
        private Integer chainType;
        private String fromAddress;
        private String toAddress;
        private String contractAddress;
        private String value;
        private String additional;
        private byte[] psw;
        private String gasPrice;
        private String gasLimit;
        private String nonce;

        public TxObj() {
            super();
        }

        public TxObj(String mmId, Integer chainType, String fromAddress, String toAddress, String contractAddress, String value, String additional, byte[] psq, String gasPrice, String gasLimit, String nonce) {
            this.mmId = mmId;
            this.chainType = chainType;
            this.fromAddress = fromAddress;
            this.toAddress = toAddress;
            this.contractAddress = contractAddress;
            this.value = value;
            this.additional = additional;
            this.psw = psq;
            this.gasPrice = gasPrice;
            this.gasLimit = gasLimit;
            this.nonce = nonce;
        }

        public String getMmId() {
            return mmId;
        }

        public void setMmId(String mmId) {
            this.mmId = mmId;
        }

        public Integer getChainType() {
            return chainType;
        }

        public void setChainType(Integer chainType) {
            this.chainType = chainType;
        }

        public String getFromAddress() {
            return fromAddress;
        }

        public void setFromAddress(String fromAddress) {
            this.fromAddress = fromAddress;
        }

        public String getToAddress() {
            return toAddress;
        }

        public void setToAddress(String toAddress) {
            this.toAddress = toAddress;
        }

        public String getContractAddress() {
            return contractAddress;
        }

        public void setContractAddress(String contractAddress) {
            this.contractAddress = contractAddress;
        }

        public String getValue() {
            return value;
        }

        public void setValue(String value) {
            this.value = value;
        }

        public String getAdditional() {
            return additional;
        }

        public void setAdditional(String additional) {
            this.additional = additional;
        }

        public byte[] getPsw() {
            return psw;
        }

        public void setPsw(byte[] psw) {
            this.psw = psw;
        }

        public String getGasPrice() {
            return gasPrice;
        }

        public void setGasPrice(String gasPrice) {
            this.gasPrice = gasPrice;
        }

        public String getGasLimit() {
            return gasLimit;
        }

        public void setGasLimit(String gasLimit) {
            this.gasLimit = gasLimit;
        }

        public String getNonce() {
            return nonce;
        }

        public void setNonce(String nonce) {
            this.nonce = nonce;
        }

        @java.lang.Override
        public java.lang.String toString() {
            return "TxObj{" +
                    "mmId='" + mmId + '\'' +
                    ", chainType=" + chainType +
                    ", fromAddress='" + fromAddress + '\'' +
                    ", toAddress='" + toAddress + '\'' +
                    ", contractAddress='" + contractAddress + '\'' +
                    ", value='" + value + '\'' +
                    ", additional='" + additional + '\'' +
                    ", psw=" + java.util.Arrays.toString(psw) +
                    ", gasPrice='" + gasPrice + '\'' +
                    ", gasLimit='" + gasLimit + '\'' +
                    ", nonce='" + nonce + '\'' +
                    '}';
        }
    }

